import React from 'react';


const Header = (props) => {
    return (
        <div>
            <h1>To Do App</h1>
            {props.timeToGetBusy ? <h2>Time to get busy</h2> : null}
            <p>Add, Edit or Delete a Todo Item.</p>
        </div>
    )
}

export default Header;
